attributes.description:
Поговорим на английском? Если вы учите английский язык и хотите "подтянуть" навык общения, то приходите на встречи клуба английского языка English speaking club. 
Клуб организован профессиональными преподавателями для свободного общения за чашечкой кофе или чая.

Есть немного правил:
количество человек — до 20;
уровень знания языка — от В1;
вход — покупка чашки вкусного кофе;
